function removeAcentos(str) {
	return str.normalize("NFD").replace(/[\u0300-\u036f]/g, "");
}

const normalizaNomePais = (nomePais) => {
	nomePais = removeAcentos(nomePais);
	nomePais = nomePais.toLowerCase();

	if (nomePais.search("\\(") !== -1) {
		let tmp = nomePais.split(' (');
		nomePais = tmp[0];
	}

	nomePais = nomePais.replaceAll('sh', 'che');
	nomePais = nomePais.replaceAll('república', '');
	nomePais = nomePais.replaceAll(' do ', '');
	nomePais = nomePais.replaceAll('norte', 'n');
	nomePais = nomePais.replaceAll('sul', 's');
	nomePais = nomePais.replaceAll('democrática', '');
	nomePais = nomePais.replaceAll('federativa', '');
	nomePais = nomePais.replaceAll('que', 'ke');
	nomePais = nomePais.replaceAll('u', 'w');
	nomePais = nomePais.replaceAll('i', 'y');
	nomePais = nomePais.replaceAll('ch', 'x');
	nomePais = nomePais.replaceAll('ss', 'ç');
	nomePais = nomePais.replaceAll('an', 'ã');
	nomePais = nomePais.replaceAll('en', 'ẽ');
	nomePais = nomePais.replaceAll('in', 'ĩ');
	nomePais = nomePais.replaceAll('on', 'õ');
	nomePais = nomePais.replaceAll('un', 'ũ');
	nomePais = nomePais.replaceAll('am', 'ã');
	nomePais = nomePais.replaceAll('em', 'ẽ');
	nomePais = nomePais.replaceAll('im', 'ĩ');
	nomePais = nomePais.replaceAll('om', 'õ');
	nomePais = nomePais.replaceAll('um', 'ũ');

	if (nomePais.charAt(nomePais.length - 1) === 'c') {
		nomePais = nomePais.split('');
		nomePais[nomePais.length - 1] = 'k'
		nomePais = nomePais.join('');
	}

	return nomePais.trim();
}

const levenshteinDistance = (a, b) => {
		if (a === undefined || b === undefined) return 1000;
		if (a.length === 0) return b.length;
		if (b.length === 0) return a.length;

		let matrix = [];

		for (let i = 0; i <= b.length; i++) {
		      matrix[i] = [i];
		}

		for (let j = 0; j <= a.length; j++) {
		      matrix[0][j] = j;
		}

		for (let i = 1; i <= b.length; i++) {
		      for (let j = 1; j <= a.length; j++) {
		             if (b.charAt(i - 1) == a.charAt(j - 1)) {
		                    matrix[i][j] = matrix[i - 1][j - 1];
		             } else {
		                    matrix[i][j] = Math.min(matrix[i - 1][j - 1] + 1,
		                    Math.min(matrix[i][j - 1] + 1, matrix[i - 1][j] + 1));
		             }
		      }
		}

		return matrix[b.length][a.length];
}

function buscaCapital(pais) {
	if (!pais) return;
	for (let i = 0; i < capitais.length; i++) {
		if (levenshteinDistance(normalizaNomePais(pais), normalizaNomePais(capitais[i][0])) <= 1) {
			return capitais[i][1];
		}
	}
}

